import React, { Component } from 'react';

/* Images */
import capabilityImg1 from '../assets/img1.jpg';
import capabilityImg2 from '../assets/img2.jpg';
import capabilityImg3 from '../assets/img3.jpg';
import capabilityImg4 from '../assets/img4.jpg';
import capabilityImg5 from '../assets/img1.jpg';

class CapabilitiesList extends Component{
   constructor(props) {
    super(props);

    this.state = {
        capabilities: [
            { title: "Business Development and Team Building", icon:"fas fa-briefcase", list:[ "Business Consulting and Analysis","Program & Project Management",
                "Task Order Management",
                "Acquisition Management",
                "Conference and Meeting Facilitation",
                "Assessment and Evaluation Tools"]},
            { title: "Staffing", icon:"fas fa-users", list:["Facilities Management Services", "Administrative/Clerical Support"]},
            { title: "IT Services", icon:"fas fa-server", list:["Staffing",
                "Database Administration",
                "System/Software Administration",
                "Network Engineering",
                "Scanning and Imaging Services"]},
            { title: "Operations", icon:"fas fa-chalkboard-teacher", list:["Warehouse Management and Operations","Mail Distribution Center Operations", "Digital Document Center Operation (Print Shop)", "Inventory management/control"]},
            { title: "Facilities Management", icon:"far fa-building", list:["Construction and Renovation"]}            
        ]
    }
   }

   render(){
      return(
         <div className="capabilities-body">
        
         </div>
      );
   }
}

export default CapabilitiesList;
